import {Button} from "react-bootstrap";

const Aside = (props) => {
  return (
    <>
      <aside>
          <h3>Lists</h3>
          <ul>
              <li><Button variant="danger" block>Pok√©mon</Button></li>
              <li><Button variant="danger" block>Abilities</Button></li>
              <li><Button variant="danger" block>Items</Button></li>
              <li><Button variant="danger" block>Egg groups</Button></li>
              <li><Button variant="danger" block>Berries</Button></li>
          </ul>
      </aside>
    </>
  );
};

export default Aside;
